import React from "react";
import Card from "../UI/Card";
import "./Card_Galeria.css";
import imagen from "../../imagenes/1.jpg"
const CardGaleria = (props) => {
	return (
		<Card  className="col-lg-4 ">
			<img className="img-fluid" src={imagen} alt="" />
			<h6>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quaerat, commodi. Asperiores magni dignissimos dolor tenetur ex qui dolorem ipsam optio, suscipit inventore doloremque quia fuga ratione, velit, sunt animi molestias.</h6>
		</Card>
	);
};

export default CardGaleria;
